import React from 'react';
import Navbar from './component/Navbar';
import Header from './component/header';
import Body from './component/Body';
import ProductImage from './component/productImage.js';
import Footer from './component/Footer';
import Particles from "react-tsparticles";
import particleConfig from './component/particleConfig';
// import particleConfig from '../src/component/particle.json'

function App() {
  const particlesInit = async (main) => {
    console.log(main);
    await loadFull(main);
  };

  const particlesLoaded = (container) => {
    console.log(container);
  };

  return (
      <>
        <div className="tkds" >
              <Particles

              height='60vh'
            id="tsparticles"
            init={particlesInit}
            loaded={particlesLoaded}
            options={{ 
              fullScreen: {
                zIndex: "0",
                enable: "false" // this is the line to change
              },
              backgroundMode: {
                enable: "true",
                zIndex: "0"
            },
              background: {
                color: {
                  value: "#4f4f4f",

                },


              },
              fpsLimit: 120,
              interactivity: {
                events: {
                  onClick: {
                    enable: true,
                    mode: "push",
                  },
                  onHover: {
                    enable: true,
                    mode: "repulse",
                  },
                  resize: true,
                },
                modes: {
                  push: {
                    quantity: 4,
                  },
                  repulse: {
                    distance: 200,
                    duration: 0.4,
                  },
                },
              },
              particles: {
                color: {
                  value: "#ffd700",
                },
                links: {
                  color: "#ffffff",
                  distance: 150,
                  enable: true,
                  opacity: 0.5,
                  width: 1,
                },
                collisions: {
                  enable: true,
                },
                move: {
                  direction: "none",
                  enable: true,
                  outModes: {
                    default: "bounce",
                  },
                  random: false,
                  speed: 1,
                  straight: false,
                },
                number: {
                  density: {
                    enable: true,
                    area: 800,
                  },
                  value: 80,
                },
                opacity: {
                  value: 0.5,
                },
                shape: {
                  type: "circle",
                },
                size: {
                  value: { min: 1, max: 5 },
                },
              },
              detectRetina: true,


            }}
          />
        </div> 
      <Navbar/>
      <Header/>
      <Body/>
      <ProductImage/>
      <Footer/>

      </>
  );
}

export default App;
